import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function BookList() {
    return (
        <>
            <section className='books'>
                <Book />
                <Book />
                <Book />
                <Book />
            </section>
        </>
    )
}

const Book = () => {
    return (
        <article>
            <img src='https://www.slashfilm.com/wp/wp-content/images/terminator-6-direction.jpg' width='300px' height='250px' alt='' />
            <h1>Terminator</h1>
            <h1> James Cameron</h1>        </article>
    )
}


ReactDOM.render(
    <>
        <BookList />

    </>

